import React, {Component} from 'react'
import { green } from 'ansi-colors'
import 'App.css'

class App extends Component{
    render(){
        return(
            <div>
            <div className="text-center" style={{
                color:'green',
                fontSize: '30px'
            }}>
                <h>Hello World!</h>
            </div>
            <div>
                Hello
            </div>
            </div>
        )
    }
}

export default App;
